import React from "react";
import {
    BrowserRouter as Router, Route, Routes
} from "react-router-dom";
import HomeMainPage from "./MainPage/HomeMainPage";
import AboutMainPage from "./MainPage/AboutMainPage";
import ProductMainPage from "./MainPage/ProductMainPage";

import HomeLink from "./LinksMainPageComponent/HomeLink";
import AboutLink from "./LinksMainPageComponent/AboutLink";
import ProductLink from "./LinksMainPageComponent/ProductLink";


export default function Ccomponent() {
    return (
        <Router>
            <div>
                <nav>
                    <ul>
                        <li>
                            <HomeLink />
                        </li>
                        <li>
                            <AboutLink />
                        </li>
                        <li>
                            <ProductLink />
                        </li>
                    </ul>
                </nav >
                <Routes>

                    <Route exact path="/" element={<HomeMainPage />} />

                    <Route exact path="/About" element={<AboutMainPage />} />

                    <Route exact path="/Product" element={<ProductMainPage />} />

                </Routes>
            </div >
        </Router >
    )
}
